import {Navbar} from "./navbar";
import "./index.css";

export function PrincipalPage(props) {
    return (
            <div> 
                <Navbar/>
                <div className="main">
                <div className="main-wrap">
                    {props.children}
                </div>
                </div>
            </div>
    );
}
